description:
Karate is a fun and rewarding sport that improves your confidence, discipline, and self defense skills. It is also a great way to get in shape and make new friends! People of all ages can learn something from training in karate. Come on out to the Williamsburg County Recreation Department on Saturday, February 2nd, 2013 to try out a FREE karate class. If you decide you like it, and want to sign up, the registration is only $30 for 8 weeks. The instructor is Owen Johnston, a certified instructor with a black belt in Heiwado Karate, and over 10 years of experience in martial arts. For more details about the instructor, visit his website at -
